import blue from '../assets/img/blue.png'
import red from '../assets/img/red.png'
import yellow from '../assets/img/yellow.png'
import green from '../assets/img/green.png'

const users = [
    { name: 'Amit', movies: [], age: 24, color: red },
    { name: 'Maor', movies: [], age: 35, color: yellow },
    { name: 'Idan', movies: [], age: 31, color: blue },
    { name: 'Inbal', movies: [], age: 38, color: green },
]
function getUsers() {
    return users
}
export const userService = {
    getUsers
}
